import React, { Component } from "react";
import Chart from "react-apexcharts";

class RadialChart extends Component {
   constructor(props) {
     super(props);
      this.state = {
        series: [10],
        options: {
         chart: {
           type: 'radialBar',
           height: 350,
         },
         plotOptions: {
           radialBar: {
             hollow: {
               size: '70%',
             }
           },
         },
         labels: ['Recouped'],
        },
      };
    }


  render() {
    return (
      <div id="chart-radial">
        <ReactApexChart
          options={this.state.options}
          series={this.state.series}
          type="radialBar"
          height={350} />
      </div>
      );
    }
  }

export default RadialChart;
